INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, '<p><img alt="" src="/Research/sites/default/files/images/17.jpg" style="width: 448px; height: 336px;" /></p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.983333587646484px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;">Allows to use client-side editors to edit content. It simplifies the installation and integration of the editor of your choice. This module replaces all other editor integration modules. No other Drupal module is required.</p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.983333587646484px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;">Wysiwyg module is capable to support any kind of client-side editor. It can be a HTML-editor (a.k.a. WYSIWYG), a<span class="Apple-converted-space">&nbsp;</span><q style="border: 0px; background-color: transparent; font-size: 13px; margin: 0px; padding: 0px; vertical-align: baseline; quotes: none; background-position: initial initial; background-repeat: initial initial;">pseudo-editor</q><span class="Apple-converted-space">&nbsp;</span>(buttons to insert markup into a textarea), or even Flash-based applications. The editor library needs to be downloaded separately. Various editors are supported (see below).</p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.983333587646484px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;">Wysiwyg module also provides an abstraction layer for other Drupal modules to integrate with any editor. This means that other Drupal modules can expose content-editing functionality, regardless of which editor you have installed.</p>\r\n', '', 'full_html'),
