('node', 'ask_expert', 0, 32, 32, 'und', 0, '<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.983333587646484px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;">That works only in case, you know about all the pagers on the page... so you can''t have two unnamed pagers (without element set) on one page.</p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.983333587646484px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;">That means, using element setting is necessary on all the pagers (except one) that can appear on one page, and all the numbers need to be unique. And using random numbers caused memory usage troubles (I think drupal allocates all lower indices in an array).</p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.983333587646484px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;">So it is not really "programmer friendly", I have suggested an element retrieval function (as in the backend the have a unique element id), that you can use without assigning your own unique ID... but it is still a feature request. See</p>\r\n', '', 'filtered_html'),
('node', 'ask_expert', 0, 33, 33, 'und', 0, '<p>&nbsp;</p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; line-height: 17.983333587646484px;">That works only in case, you know about all the pagers on the page... so you can''t have two unnamed pagers (without element set) on one page.</p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; line-height: 17.983333587646484px;">That means, using element setting is necessary on all the pagers (except one) that can appear on one page, and all the numbers need to be unique. And using random numbers caused memory usage troubles (I think drupal allocates all lower indices in an array).</p>\r\n<p style="border: 0px; background-color: rgb(255, 255, 255); font-size: 13px; margin: 0px 0px 1.385em; padding: 0px; vertical-align: baseline; color: rgb(34, 34, 34); font-family: ''Lucida Grande'', ''DejaVu Sans'', ''Bitstream Vera Sans'', Verdana, Arial, sans-serif; line-height: 17.983333587646484px;">So it is not really "programmer friendly", I have suggested an element retrieval function (as in the backend the have a unique element id), that you can use without assigning your own unique ID... but it is still a feature request. See</p>\r\n', '', 'filtered_html');
