s'', Verdana, Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.983333587646484px; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;">So it is not really "programmer friendly", I have suggested an element retrieval function (as in the backend the have a unique element id), that you can use without assigning your own unique ID... but it is still a feature request. See</p>\r\n', '', 'filtered_html'),
